DROP TABLE IF EXISTS `ds_user`;
CREATE TABLE `ds_user` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `mobileNo` varchar(15) DEFAULT NULL COMMENT '手机号',
  `password` varchar(50) DEFAULT NULL COMMENT '登陆密码',
  `plateNo` varchar(10) DEFAULT NULL COMMENT '车牌号',
  `fullName` varchar(10) DEFAULT NULL COMMENT '姓名',
  `carType` varchar(255) DEFAULT NULL COMMENT '车型',
  `tonnage` int(11) DEFAULT '0' COMMENT '装货吨数',
  `portNo` varchar(255) DEFAULT NULL COMMENT '港口账号',
  `portPassword` varchar(50) DEFAULT NULL COMMENT '港口密码',
  `inviteCode` varchar(10) DEFAULT NULL COMMENT '邀请码',
  `bankCard` varchar(30) DEFAULT NULL COMMENT '银行卡',
  `bankName` varchar(255) DEFAULT NULL COMMENT '银行户名',
  `bankOpen` varchar(255) DEFAULT NULL COMMENT '开户行',
  `userId` int(11) DEFAULT '0' COMMENT '上级会员ID',
  `integral` int(11) NOT NULL DEFAULT '0' COMMENT '个人积分',
  `registerDateTime` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '注册时间',
  `statusAudit` tinyint(1) DEFAULT '0' COMMENT '审核状态',
  `reason` varchar(255) DEFAULT NULL COMMENT '审核未通过原因',
  `openid` char(30) DEFAULT '' COMMENT 'openid',
  `nickname` text COMMENT '微信昵称',
  `sex` tinyint(1) DEFAULT '0' COMMENT '微信性别',
  `country` varchar(255) DEFAULT NULL COMMENT '微信国家',
  `province` varchar(255) DEFAULT NULL COMMENT '微信省份',
  `city` varchar(255) DEFAULT NULL COMMENT '微信城市',
  `headimgurl` text COMMENT '微信头像',
  `subscribe` tinyint(1) DEFAULT '0' COMMENT '是否关注微信',
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='会员';

